function Main() {
    return(
        <div className="main_main_4">
            <div style={{fontSize: 20}}>03 - Expedition Timeline</div>
            <div>
                <div style={{display: "flex", flexDirection: "row"}}><div style={{color: "#917B39"}}>Timeline</div> <div style={{color: "#252D29"}}>s</div>of Kalimantan Jungle Expedition</div>
                <div>The expedition is divided into several stages, starting from the <b>planning</b> stage, <b>preparation</b> stage, <b>endurance</b> test and finally the <b>implementation</b> stage.</div>
            </div>
        </div>
    )
}

export default Main
